import React from "react";
import "./Main.css";
import { TypeAnimation } from "react-type-animation";

function Main() {
  return (
    <section className="main-container" id="home">
      <div className="main-content">
        <h2 className="animated-text">
          <TypeAnimation
            sequence={["Hi! I'm Fiza", 1000, "Hi! I'm Fiza", 1000]}
            wrapper="span"
            speed={50}
            style={{ fontSize: "20px", display: "inline-block" }}
            repeat={Infinity}
          />
        </h2>
        <p>
          Passionate and dedicated aspiring Front-end Developer with a strong
          foundation in front-end technologies, I am actively seeking an
          opportunity to contribute to a dynamic team and gain practical
          experience in front-end development. I am well-prepared to tackle new
          challenges and grow as a professional in front-end development.
        </p>
        <a href="./assets/Fiza Portfolio.pdf" download>
          <button className="download-cv">Download CV</button>
        </a>
      </div>

      <div className="main-img">
        <div>
          {/* <img src="./assets/images/anime.jpg" alt="Profile" /> */}
          <img src="./assets/images/fizaimage.jpeg" alt="Profile" />
        </div>
        <div>
          <h2 className="profession">Front-End Developer</h2>
        </div>
      </div>
    </section>
  );
}

export default Main;
